int distance_squared(int x1, int y1, int x2, int y2) {
    int dx = x2 - x1;
    int dy = y2 - y1;
    return dx*dx + dy*dy;
}

int get_distance(int i, int j) {
    int dx = intersections[i].x - intersections[j].x;
    int dy = intersections[i].y - intersections[j].y;
    return abs(dx) + abs(dy);
}




int find_nearest_intersection(int x, int y) {
    int nearest = -1;
    int min_dist = 0x7FFFFFFF;
    
    for (int i = 0; i < intersection_count; i++) {
        int dist = distance_squared(x, y, intersections[i].x, intersections[i].y);
        if (dist < min_dist) {
            min_dist = dist;
            nearest = i;
        }
    }
    
    return nearest;
}

void get_nearest_intersection(int x, int y, int *intersection_x, int *intersection_y, int *intersection_index) {
    int nearest = find_nearest_intersection(x, y);
    
    if (nearest >= 0) {
        *intersection_x = intersections[nearest].x;
        *intersection_y = intersections[nearest].y;
        *intersection_index = nearest;
    } else {
        // if no intersection is found
        *intersection_x = x;
        *intersection_y = y;
        *intersection_index = -1;
    }
}
