void dijkstra(int start_vertex, int end_vertex) {
    int cost[MAX_INTERSECTIONS][MAX_INTERSECTIONS];
    int distance[MAX_INTERSECTIONS];
    int visited[MAX_INTERSECTIONS];
    int predecessor[MAX_INTERSECTIONS];
    int count, min_distance, next_node;
    
    for (int i = 0; i < intersection_count; i++) {
        for (int j = 0; j < intersection_count; j++) {
            if (road_network[i][j] == 0)
                cost[i][j] = INFINITY;
            else
                cost[i][j] = road_network[i][j];
        }
    }
    
    for (int i = 0; i < intersection_count; i++) {
        distance[i] = cost[start_vertex][i];
        predecessor[i] = start_vertex;
        visited[i] = 0;
    }
    
    distance[start_vertex] = 0;
    visited[start_vertex] = 1;
    count = 1;
    
    while (count < intersection_count - 1) {
        min_distance = INFINITY;
        
        for (int i = 0; i < intersection_count; i++) {
            if (distance[i] < min_distance && !visited[i]) {
                min_distance = distance[i];
                next_node = i;
            }
        }
        
        visited[next_node] = 1;
        
        for (int i = 0; i < intersection_count; i++) {
            if (!visited[i] && min_distance + cost[next_node][i] < distance[i]) {
                distance[i] = min_distance + cost[next_node][i];
                predecessor[i] = next_node;
            }
        }
        count++;
    }
    
    int j = end_vertex;
    path_length = 0;
    
    do {
        path[path_length++] = j;
        j = predecessor[j];
    } while (j != start_vertex);
    
    path[path_length++] = start_vertex;
    
    for (int i = 0; i < path_length / 2; i++) {
        int temp = path[i];
        path[i] = path[path_length - i - 1];
        path[path_length - i - 1] = temp;
    }
}

void draw_line(int x0, int y0, int x1, int y1, unsigned short color) {
    int dx = abs(x1 - x0);
    int sx = x0 < x1 ? 1 : -1;
    int dy = -abs(y1 - y0);
    int sy = y0 < y1 ? 1 : -1;
    int err = dx + dy;
    int e2;
    
    while (1) {
        if (x0 >= 0 && x0 < xn && y0 >= 0 && y0 < yn) {
            fbp->pixels[y0][x0] = color;
        }
        
        if (x0 == x1 && y0 == y1) break;
        
        e2 = 2 * err;
        if (e2 >= dy) {
            if (x0 == x1) break;
            err += dy;
            x0 += sx;
        }
        if (e2 <= dx) {
            if (y0 == y1) break;
            err += dx;
            y0 += sy;
        }
    }
}

void draw_intersection(int x, int y, unsigned short color) {
    for (int i = -5; i <= 5; i++) {
        for (int j = -5; j <= 5; j++) {
            if (i*i + j*j <= 25) {
                int draw_x = x + i;
                int draw_y = y + j;
                if (draw_x >= 0 && draw_x < xn && draw_y >= 0 && draw_y < yn) {
                    fbp->pixels[draw_y][draw_x] = color;
                }
            }
        }
    }
}



void draw_path(unsigned short color) {
    for (int i = 0; i < path_length - 1; i++) {
        int start = path[i];
        int end = path[i + 1];
        draw_line(
            intersections[start].x, intersections[start].y,
            intersections[end].x, intersections[end].y,
            color
        );
        if (intersections[start].x == intersections[end].x) {
            draw_line(
                intersections[start].x - 1, intersections[start].y,
                intersections[end].x - 1, intersections[end].y,
                color
            );
            draw_line(
                intersections[start].x + 1, intersections[start].y,
                intersections[end].x + 1, intersections[end].y,
                color
            );
        } 
        else if (intersections[start].y == intersections[end].y) {
            draw_line(
                intersections[start].x, intersections[start].y - 1,
                intersections[end].x, intersections[end].y - 1,
                color
            );
            draw_line(
                intersections[start].x, intersections[start].y + 1,
                intersections[end].x, intersections[end].y + 1,
                color
            );
        }
    }
}

void display_map() {
    for (int y = 0; y < yn; y++) {
        for (int x = 0; x < xn; x++) {
            fbp->pixels[y][x] = map[y*xn + x];
        }
    }
}

#define MAP_MAX_X 227
#define MAP_MAX_Y 239
#define MAP_MIN_X 0
#define MAP_MIN_Y 0


void draw_cursor(int x, int y, unsigned short color) {
    // Draw the cross pattern:
    // 0,1,0
    // 1,1,1
    // 0,1,0
    
    // Center point
    if (x >= MAP_MIN_X && x < MAP_MAX_X && y >= MAP_MIN_Y && y < MAP_MAX_Y) {
        fbp->pixels[y][x] = color;
    }
    
    // Top
    if (x >= MAP_MIN_X && x < MAP_MAX_X && y-1 >= MAP_MIN_Y && y-1 < MAP_MAX_Y) {
        fbp->pixels[y-1][x] = color;
    }
    
    // Bottom
    if (x >= MAP_MIN_X && x < MAP_MAX_X && y+1 >= MAP_MIN_Y && y+1 < MAP_MAX_Y) {
        fbp->pixels[y+1][x] = color;
    }
    
    // Left
    if (x-1 >= MAP_MIN_X && x-1 < MAP_MAX_X && y >= MAP_MIN_Y && y < MAP_MAX_Y) {
        fbp->pixels[y][x-1] = color;
    }
    
    // Right
    if (x+1 >= MAP_MIN_X && x+1 < MAP_MAX_X && y >= MAP_MIN_Y && y < MAP_MAX_Y) {
        fbp->pixels[y][x+1] = color;
    }
}



#define STEP_SIZE 20

int check_key_press() {
    // Check the edge capture register
    unsigned int edge = key_pit->EDGE;
    
    // If any key was pressed and released
    if (edge) {
        if (edge & 0x1) {
            if (start_x + STEP_SIZE <= MAP_MAX_X) start_x += STEP_SIZE;
            else start_x = MAP_MAX_X;
            key_pit->EDGE = 0x1; // Clear KEY0 edge capture bit
            return 1;
        }
        else if (edge & 0x2) {
            if (start_x - STEP_SIZE >= MAP_MIN_X) start_x -= STEP_SIZE;
            else start_x = MAP_MIN_X;
            key_pit->EDGE = 0x2; // Clear KEY1 edge capture bit
            return 1;
        }
        else if (edge & 0x4) {
            if (start_y + STEP_SIZE <= MAP_MAX_Y) start_y += STEP_SIZE;
            else start_y = MAP_MAX_Y;
            key_pit->EDGE = 0x4; // Clear KEY2 edge capture bit
            return 1;
        }
        else if (edge & 0x8) {
            if (start_y - STEP_SIZE >= MAP_MIN_Y) start_y -= STEP_SIZE;
            else start_y = MAP_MIN_Y;
            key_pit->EDGE = 0x8; // Clear KEY3 edge capture bit
            return 1;
        }
    }
    
    return 0; // No key was pressed
}

// Check switches and update navigation_enabled based on SW7
// Returns 1 if navigation state changed, 0 otherwise
int check_switches() {
    static int previous_nav_state = -1;
    static int previous_library = -1;
    
    // Read the switch data
    unsigned int switches = sw_pit->DATA;
    
    // Determine navigation state (SW7)
    int new_nav_state = (switches & 0x80) ? 1 : 0;
    
    // Determine library choice (SW0-SW3)
    int new_library = 1; // Default to library 1 (Robarts)
    
    if (switches & 0x1) {        // SW0 is ON
        new_library = 1;         // Robarts Library
    } else if (switches & 0x2) { // SW1 is ON
        new_library = 2;         // Trinity College Library
    } else if (switches & 0x4) { // SW2 is ON
        new_library = 3;         // Gerstein Library
    } else if (switches & 0x8) { // SW3 is ON
        new_library = 4;         // SF Library
    }
    
    // Check if anything changed
    int changed = 0;
    
    if (new_nav_state != previous_nav_state) {
        navigation_enabled = new_nav_state;
        previous_nav_state = new_nav_state;
        changed = 1;
    }
    
    if (new_library != previous_library) {
        library_choice = new_library;
        previous_library = new_library;
        changed = 1;
    }
    
    return changed;
}

int select_library(int library_number) {
    if (library_number == 1) {
        return 28;
    } else if (library_number == 2) {
        return 29;
    } else if (library_number == 3) {
        return 31;
    } else if (library_number == 4) {
    	return 30;
    } else return -1;
}

// Define JTAG UART base address
#define JTAG_UART_BASE 0xFF201000

// Structure for JTAG UART registers
typedef struct {
    volatile int DATA;           // Data register (offset 0x0)
    volatile int CONTROL;        // Control register (offset 0x4)
} JTAG_UART;

// Create a pointer to JTAG UART
JTAG_UART *const jtag_uart = (JTAG_UART*) JTAG_UART_BASE;

// Read a character from JTAG UART (non-blocking)
char get_jtag_char() {
    int data = jtag_uart->DATA;
    
    // Check RVALID bit to see if there is data
    if (data & 0x00008000) {
        return (char)(data & 0xFF);
    }
    
    return '\0'; // No data available
}

// Write a character to JTAG UART
void put_jtag_char(char c) {
    // Check if there's space in the transmit FIFO
    int control = jtag_uart->CONTROL;
    if (control & 0xFFFF0000) { // Check WSPACE > 0
        jtag_uart->DATA = c;
    }
}

// Write a string to JTAG UART
void put_jtag_string(const char *str) {
    while (*str) {
        put_jtag_char(*str++);
    }
}

// Read a line from JTAG UART (blocking until newline)
int get_jtag_line(char *buffer, int max_length) {
    int index = 0;
    char c;
    
    put_jtag_string("\nEnter starting coordinates (x,y): ");
    
    while (index < max_length - 1) {
        c = get_jtag_char();
        
        if (c == '\0') {
            // No character available, try again in the next loop iteration
            continue;
        } else if (c == '\r' || c == '\n') {
            // Echo carriage return/newline
            put_jtag_char('\r');
            put_jtag_char('\n');
            break;
        } else {
            // Echo the character back
            put_jtag_char(c);
            
            // Add to buffer
            buffer[index++] = c;
        }
    }
    
    // Null-terminate the string
    buffer[index] = '\0';
    return index;
}

// Parse coordinates in the format "x,y"
int parse_jtag_coordinates(char *input, int *x, int *y) {
    int parsed_x, parsed_y;
    char *comma_pos = 0;
    
    // Find comma
    for (int i = 0; input[i] != '\0'; i++) {
        if (input[i] == ',') {
            comma_pos = &input[i];
            break;
        }
    }
    
    // If no comma found, return error
    if (comma_pos == 0) {
        return 0;
    }
    
    // Temporarily replace comma with null terminator
    *comma_pos = '\0';
    
    // Parse x value
    parsed_x = 0;
    for (char *p = input; *p != '\0'; p++) {
        if (*p >= '0' && *p <= '9') {
            parsed_x = parsed_x * 10 + (*p - '0');
        } else {
            // Non-digit character found
            *comma_pos = ','; // Restore comma
            return 0;
        }
    }
    
    // Parse y value
    parsed_y = 0;
    for (char *p = comma_pos + 1; *p != '\0'; p++) {
        if (*p >= '0' && *p <= '9') {
            parsed_y = parsed_y * 10 + (*p - '0');
        } else {
            // Non-digit character found
            *comma_pos = ','; // Restore comma
            return 0;
        }
    }
    
    // Restore comma
    *comma_pos = ',';
    
    // Validate coordinates are within map bounds
    if (parsed_x < MAP_MIN_X || parsed_x > MAP_MAX_X || 
        parsed_y < MAP_MIN_Y || parsed_y > MAP_MAX_Y) {
        return 0;
    }
    
    // Store valid coordinates
    *x = parsed_x;
    *y = parsed_y;
    return 1;
}

// Check for JTAG UART input and update start coordinates if available
int check_jtag_uart() {
    char buffer[64];
    int new_x, new_y;
    
    // Check if there's any data in the JTAG UART
    int data = jtag_uart->DATA;
    if (!(data & 0x00008000)) {
        return 0; // No data available
    }
    
    // Data is available, read a line
    if (get_jtag_line(buffer, sizeof(buffer)) > 0) {
        // Try to parse coordinates
        if (parse_jtag_coordinates(buffer, &new_x, &new_y)) {
            // Update start coordinates
            start_x = new_x;
            start_y = new_y;
            
            // Send confirmation
            char message[64];
            sprintf(message, "Starting position updated to: %d,%d\r\n", start_x, start_y);
            put_jtag_string(message);
            
            return 1; // Coordinates were updated
        } else {
            // Invalid format
            put_jtag_string("Invalid coordinates format. Use 'x,y' within map bounds.\r\n");
        }
    }
    
    return 0;
}

int main() {
    // Initialize road network
    initialize_road_network();
    
    // Reset edge capture register at startup
    key_pit->EDGE = 0xF;
    
    // Display the initial map
    display_map();
    
    // Send initial message to JTAG UART
    put_jtag_string("\r\nMap Navigation System\r\n");
    put_jtag_string("Current position: ");
    char pos_msg[32];
    sprintf(pos_msg, "%d,%d\r\n", start_x, start_y);
    put_jtag_string(pos_msg);
    
    // Draw the initial cursor
    draw_cursor(start_x, start_y, COLOR_BLACK);
    
    // For tracking if we need to redraw
    int needs_redraw = 0;
    
    // Main loop - now continuously checks switches without blocking
    while (1) {
        // Check for key presses (non-blocking)
        int key_pressed = check_key_press();
        
        // Check if switch state changed
        int switch_changed = check_switches();
        
        // Check for JTAG UART input
        int jtag_updated = check_jtag_uart();
        
        // Determine if we need to redraw the screen
        needs_redraw = key_pressed || switch_changed || jtag_updated;
        
        // Redraw the display if needed
        if (needs_redraw) {
            // Redisplay the map
            display_map();
            
            // If navigation is enabled (controlled by SW7), show the route
            if (navigation_enabled) {
                int nearest_x, nearest_y, start_index;
                get_nearest_intersection(start_x, start_y, &nearest_x, &nearest_y, &start_index);
                
                int dest_index = select_library(library_choice);
                
                // Draw the path
                if (start_index >= 0 && dest_index >= 0) {
                    dijkstra(start_index, dest_index);
                    draw_path(COLOR_BLUE);
                    draw_intersection(intersections[start_index].x, intersections[start_index].y, COLOR_GREEN);
                    draw_intersection(intersections[dest_index].x, intersections[dest_index].y, COLOR_CYAN);
                }
            }
            
            // Always draw the cursor at the current position
            draw_cursor(start_x, start_y, COLOR_BLACK);
        }
        
        // Small delay to prevent the processor from running at maximum speed
        for (int i = 0; i < 10000; i++) {
            // Simple delay loop
        }
    }
    
    return 0;
}